%[text] # Htrig C3
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] ## Graphene
syms t a k_x k_y real;
a = 1;
bond = sqrt(3)/3 *a;
delta(1,:) = a*[1/2,-sqrt(3)/6];
delta(2,:) = a*[  0,    bond/a];
delta(3,:) = a*[-1/2,-sqrt(3)/6];
sigma_x = pauli_matrix(1);
sigma_y = pauli_matrix(2);
sigma_z = pauli_matrix(3);
k = [k_x k_y].';
% Model
% 

Graphene = Htrig(2);
Graphene = Graphene +...
    Trig(-t*cos(delta(1,:)*k),sigma_x)+...
    Trig( t*sin(delta(1,:)*k),sigma_y)+...
    Trig(-t*cos(delta(2,:)*k),sigma_x)+...
    Trig( t*sin(delta(2,:)*k),sigma_y)+...
    Trig(-t*cos(delta(3,:)*k),sigma_x)+...
    Trig( t*sin(delta(3,:)*k),sigma_y);
Graphene_sym = Graphene.Htrig_sym %[output:19ec6891]
Graphene_sym = simplify(rewrite(Graphene_sym,'exp')) %[output:4c7f4607]
% Band

t =1;
Graphene_n  = Graphene.Subsall();
Graphene_n = Graphene_n<'POSCAR';
Graphene_n = Graphene_n <'KPOINTS';
EIGENCAR = Graphene_n.EIGENCAR_gen(); %[output:1b7a4771]
[klist_l,kpoints_l,kpoints_name] = Graphene_n.kpath_information();
bandplot(EIGENCAR,[-3,3],klist_l,kpoints_l,kpoints_name,'title','Graphene','Color','r'); %[output:73de1bcd]
%
Graphene = Graphene <'POSCAR';
Graphene_hr = Graphene.Htrig2HR(); %[output:9f040beb]
Graphene_hr.show('TwoD',1) %[output:33ef4bac] %[output:765d4ab1]
