%[text] ## Kane-Mele
%[text]{"align":"center"} ![](text:image:8ba0)
%[text]{"align":"center"} ![](text:image:8669)
%[text]{"align":"center"} ![](text:image:83d2)
%[text]{"align":"center"} ![](text:image:252a)
%[text]{"align":"center"} ![](text:image:2394)
%[text] ## Model
syms t a lambda_SO lambda_v lambda_R Mz My Mx k_x k_y real;
syms q_x q_y;
sigma_z = pauli_matrix(3);sigma_x = pauli_matrix(1);
sigma_0 = pauli_matrix(0);sigma_y = pauli_matrix(2);
q_x = k_x/2;
q_y = sqrt(3)/2 *k_y;
%KaneMele = Htrig(4);
% try another type 
TYPE = 'sincos';% 'exp' 'sincos' 
KaneMele = Htrig(4,'Type',TYPE);
KaneMele = KaneMele+...
    Trig(4*lambda_SO*sin(q_x)*(cos(q_x)-cos(q_y)),gamma_matrix(1,5))+...
    Trig(-lambda_v                               ,gamma_matrix(3  ))+...
    Trig(-t*(2*cos(q_x)+cos(q_y))                ,gamma_matrix(1  ))+...
    Trig(-t*(sin(q_y))                           ,gamma_matrix(1,3))+...
    Trig(4*lambda_SO*sin(q_x)*(cos(q_x)-cos(q_y)),gamma_matrix(1,5))+...
    Trig(Mz                                      ,sigma_z*sigma_0)+...
    Trig(Mx                                      ,sigma_x*sigma_0)+...
    Trig(My                                      ,sigma_y*sigma_0);

%
KaneMele_hr = KaneMele.Htrig2HR(); %[output:9af30bf3] %[output:2088554b]
KaneMele_hr.show('TwoD',1) %[output:2dd750a4] %[output:017469f4]
%%
%[text] ### Band
a = 1;t =1;lambda_SO =0.02;lambda_v=0.0;lambda_R = 0.0;Mz = 0;Mx = 0;My = 0;
KaneMele_n  = KaneMele.Subsall();
KaneMele_n = KaneMele_n < 'POSCAR';
KaneMele_n = KaneMele_n <'KPOINTS';
EIGENCAR = KaneMele_n.EIGENCAR_gen(); %[output:5d5e1bf6]
[klist_l,kpoints_l,kpoints_name] = KaneMele_n.kpath_information();
bandplot(EIGENCAR,[-3,3],klist_l,kpoints_l,kpoints_name,'title','KaneMele','Color','r'); %[output:0f8f5c3b]
